import Head from "next/head";
import Link from "next/link";

export default function Project() {

  return (
    <div className="container bg-indigo-800 w-full">
      <Head>
        <title>Samantha</title>
        <link rel="icon" href="/favicon.ico" />
      </Head>

      <main className="w-screen">
        <h1 className="text-indigo-300 text-3xl">
      Samantha
        </h1>

        <div className="flex flex-row justify-center">
          <Link href={project}>
          {["midori","shareit"].map((project => <img src={project + ".png"} alt={project} className="w-5/12 h-1/4 border-4 border-light-blue-500 border-opacity-100 ml-3 mt-4"/>
          ))}</Link>
        </div>

      </main>

    </div>
  );
}
